export default function Food(props: [string, number, React.MouseEventHandler<HTMLDivElement>]) {
  // key:string, name: string, price: number, onAdd: React.MouseEventHandler<HTMLDivElement>
  const [name, price, onAdd] = props;
  return (
    <>
    <div id={name} onClick={onAdd}>{name}</div>
    <div id={name}>{price}</div>
    </>
  )
}
